text:
i shed my skin,
to delicately dive in,
the new skin i sought;
could not just be bought.

i financed my dreams,
with pennies to my knees,
invested in my transformation;
saw no light at the end of a tunnel.

my pinkie toes were numb,
from squeezing into too tight heels,
trying to reclaim the advances;
of someone who plead 'i do', in front of god.

for christ's sake, 
he made no mistakes;
he turned me anew...
to the life i should lead.

for years i fought,
to be the same;
as my siblings, and loved ones,
who had no idea what awaited;

my confession & submission,
to the woman i am now;
i don't do what you ask of me,
because i've grown to know,
i have a life of my own.

rainn2.24.2014 #writemetoexist #thepoet #awakening #shadowlady #trustyourintuition  #themessiah #prophecy #iamdivinequeen #metoo #resist  #keeperoftheflame  #wearefree #theamethystqueen #letitbe #capricorn #godisawoman #lilithmoon  #synchronicity #soulmaster #resist #evolution  #lyricalgoddess #igaveupmyfirstborntobehere #theladygoat #thegoat #queencrybaby

